var banqApprovalOutsidePictures_deletedFiles = new Array();//要删除的图片文件id

/******************************banq_approval_outside_pictures_page---begin**************************************/
banq_approval_outside_pictures_page.live('pageinit',function(e, ui){
	var wrapper = "banq_approval_outside_pictures_wrapper";
//	var up = "banq_approval_outside_pictures_pullUp";
//	var down = "banq_approval_outside_pictures_pullDown";
	banq_approval_outside_pictures_myScroll = createMyScroll(wrapper);

	banq_approval_outside_pictures_page.find(".BackBtn").live("tap",function(event){
		event.stopPropagation();
		back_page('workbench_page');
		removeImageObject();
		return false;
	});

	//点击上传文件
	banq_approval_outside_pictures_page.find(".SaveBtn2").live("tap",function(){
		
		banqApproval_OutSide_Pictures_uploadPictures();
	});

	//点击删除图片
	banq_approval_outside_pictures_page.find('[tag="picBox"] dd').live("tap",function(){

		//获取要删除的文件名
		var $currentImage = $(this).parent().find('img');

		//如果是删除了已保存的照片，则将此照片从服务端也删除
		if($currentImage.attr("status")== "saved"){
			banqApprovalOutsidePictures_deletedFiles.push($currentImage.attr("pictureId"));
			$(this).parent().remove();
		}
		else{
			$(this).parent().remove();
		}
	});

	//图片点击放大
	banq_approval_outside_pictures_page.find('[tag="picBox"] img').live("tap",function(){  

		var currentPage = $("#banq_approval_outside_pictures_page");
		var fileBase64EncodeStr = "";
		var listImg = currentPage.find('[tag="picBox"] img');
		var photoIndex = listImg.index($(this));

		for (var i = 0; i < listImg.size(); i++) {
			fileBase64EncodeStr = fileBase64EncodeStr + "@" + $(listImg.get(i)).attr("src").replace("data:image/jpeg;base64,","");
		}
		
		fileBase64EncodeStr = fileBase64EncodeStr.substring(1);
		sendPictures(fileBase64EncodeStr,photoIndex);
	});
	
});

